"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Vertigo (a type of dizziness) (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/vertigo-a-type-of-dizziness-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H1742292300\">",
"      <span class=\"h1\">",
"       What are dizziness and vertigo?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Dizziness is a feeling that is hard to describe. It often makes you feel like you are about to fall or pass out. Dizziness can also cause you to feel lightheaded or make it hard for you to walk straight.",
"     </p>",
"     <p>",
"      Many people who feel dizzy have vertigo, a type of dizziness. Vertigo makes you feel like you are spinning, swaying, or tilting, or like the room is moving around you. These feelings come and go, and may last seconds, hours, or days. You may feel worse when you move your head, change positions, cough, or sneeze.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1742292307\">",
"      <span class=\"h1\">",
"       What causes vertigo?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The most common causes of vertigo include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        <strong>",
"         Inner ear problems",
"        </strong>",
"        &mdash; Deep inside the ear, there is a small network of tubes that are filled with fluid. Floating inside that fluid are special calcium deposits. Together, these tubes and deposits make up the &ldquo;vestibular system.&rdquo; This system tells the brain what position the body is in. It also helps keep you balanced (",
"        <a class=\"graphic graphic_figure graphicRef52509 \" href=\"mobipreview.htm?34/48/35589\">",
"         figure 1",
"        </a>",
"        ).",
"        <br/>",
"        <br/>",
"        If the tubes inside your inner ear get swollen, or if they form extra calcium deposits, you can lose your balance and develop vertigo. You can also get vertigo if swelling puts pressure on nerves in the inner ear. Sometimes this swelling is caused by a viral infection.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <strong>",
"         Head injury",
"        </strong>",
"        &mdash; Head injuries can disturb the inner ear and lead to vertigo.",
"       </li>",
"       <li>",
"        <strong>",
"         Medicines",
"        </strong>",
"        &mdash; Some medicines can damage the inner ear and cause vertigo.",
"       </li>",
"       <li>",
"        <strong>",
"         Migraine headaches",
"        </strong>",
"        &mdash; For reasons doctors do not really understand, migraine headaches can sometimes cause vertigo.",
"       </li>",
"       <li>",
"        <strong>",
"         Brain problems",
"        </strong>",
"        &mdash; Brain problems, such as stroke or multiple sclerosis, can also cause vertigo.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1742292314\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;See your doctor or nurse right away if you have vertigo and:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Have a new or severe headache",
"       </li>",
"       <li>",
"        Have a fever higher than 100.4&ordm;F (38&ordm;C)",
"       </li>",
"       <li>",
"        Start to see double or have trouble seeing clearly",
"       </li>",
"       <li>",
"        Have trouble speaking or hearing",
"       </li>",
"       <li>",
"        Have weakness in an arm or leg or your face droops to one side",
"       </li>",
"       <li>",
"        Pass out",
"       </li>",
"       <li>",
"        Have numbness or tingling",
"       </li>",
"       <li>",
"        Have chest pain",
"       </li>",
"       <li>",
"        Cannot stop vomiting",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      You should also see your doctor or nurse if you have vertigo that lasts for several minutes or more and you:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Are older than 60",
"       </li>",
"       <li>",
"        Had a stroke in the past",
"       </li>",
"       <li>",
"        Are at risk for having a stroke, for example because you have diabetes or you smoke",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      If you have dizziness or vertigo that comes and goes but you do not have any of the problems listed above, make an appointment with your doctor or nurse.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1742292321\">",
"      <span class=\"h1\">",
"       How is vertigo treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If your doctor knows what is causing your vertigo, he or she will probably try to treat that problem directly. For instance, if you have calcium deposits in your inner ear, the doctor might try to get them out by moving your head in a special way.",
"     </p>",
"     <p>",
"      If the doctor does not know what is causing your vertigo, he or she can give you treatments for the symptoms that come with vertigo. For example, the doctor can give you medicines to relieve nausea and vomiting.",
"     </p>",
"     <p>",
"      If your vertigo is really bad, your doctor might also suggest a treatment called &ldquo;balance rehabilitation.&rdquo; This treatment teaches you exercises that can help you cope with your vertigo.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1742292328\">",
"      <span class=\"h1\">",
"       What can I do on my own to deal with my vertigo?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you have trouble standing or walking because of vertigo, you are at risk of falling. To reduce the risk of falls, make your home as safe as possible. Get rid of loose electrical cords, clutter, and slippery rugs. Also, make sure that you wear sturdy, non-slip shoes, and that your walkways are clear and well lit.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1742292335\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"mobipreview.htm?40/31/41460?source=see_link\">",
"       Patient information: Dizziness and vertigo (Beyond the Basics)",
"      </a>",
"     </p>",
