"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"mobipreview.htm?7/13/7379?source=see_link\">",
"       Patient information: Health and nutrition for women who breastfeed (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"mobipreview.htm?6/15/6387?source=see_link\">",
"       Patient information: Vitamin B12 deficiency and folate (folic acid) deficiency (The Basics)",
"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"mobipreview.htm?30/54/31588?source=see_link\">",
"       Patient information: Maternal health and nutrition during breastfeeding (Beyond the Basics)",
"      </a>",
"     </p>",
"    </div>",
