"     20 mg/0.5 mL (0.5 mL): $365.15",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     80 mg/2 mL (2 mL): $1460.60",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Concentrate",
"     </b>",
"     (Taxotere Intravenous)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     20 mg/mL (1 mL): $518.94",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     80 mg/2 mL (2 mL): $1976.89",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     80 mg/4 mL (4 mL): $2075.74",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Solution",
"     </b>",
"     (DOCEtaxel Intravenous)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     20 mg/2 mL (2 mL): $222.07",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     80 mg/8 mL (8 mL): $888.30",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     160 mg/16 mL (16 mL): $1758.90",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Solution (reconstituted)",
"     </b>",
"     (Docefrez Intravenous)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     20 mg (1): $322.55",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     80 mg (1): $1290.40",
"    </p>",
"   </div>",
"   <div class=\"block mop drugH1Div\" id=\"F162026\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Monitoring Parameters",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     CBC with differential, liver function tests, bilirubin, alkaline phosphatase, renal function; monitor for hypersensitivity reactions, neurosensory symptoms, gastrointestinal toxicity (eg, diarrhea, stomatitis), cutaneous reactions, fluid retention, epiphora, and canalicular stenosis",
"    </p>",
"   </div>",
