"   <div class=\"block pha drugH1Div\" id=\"F162017\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Docetaxel promotes the assembly of microtubules from tubulin dimers, and inhibits the depolymerization of tubulin which stabilizes microtubules in the cell. This results in inhibition of DNA, RNA, and protein synthesis. Most activity occurs during the M phase of the cell cycle.",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F162033\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Exhibits linear pharmacokinetics at the recommended dosage range",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution: Extensive extravascular distribution and/or tissue binding; V",
"     <sub>",
"      dss",
"     </sub>",
"     : 113 L (mean steady state)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding: ~94% to 97%, primarily to alpha",
"     <sub>",
"      1",
"     </sub>",
"     -acid glycoprotein, albumin, and lipoproteins",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Hepatic; oxidation via CYP3A4 to metabolites",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: Terminal: ~11 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Feces (~75%, &lt;8% as unchanged drug); urine (~6%)",
"    </p>",
"   </div>",
