var title_f40_59_41915="Diabetes screening tests PI";
var content_f40_59_41915=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PI%2F71506&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PI%2F71506&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Diabetes screening tests",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Glucose level",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Fasting glucose",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Normal",
"       </td>",
"       <td>",
"        70 to 99",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Pre-diabetes",
"       </td>",
"       <td>",
"        100 to 125",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Diabetes",
"       </td>",
"       <td>",
"        126 or higher on at least 2 tests",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Glucose tolerance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Normal",
"       </td>",
"       <td>",
"        Below 140",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Pre-diabetes",
"       </td>",
"       <td>",
"        140 to 199",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td class=\"indent1\">",
"        Diabetes",
"       </td>",
"       <td>",
"        200 or higher on at least 2 tests",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        A1C percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        A1C",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Normal",
"       </td>",
"       <td>",
"        Below 5.7",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Pre-diabetes",
"       </td>",
"       <td>",
"        5.7 to 6.4",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Diabetes",
"       </td>",
"       <td>",
"        6.5 or higher on at least 2 tests",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Pre-diabetes is a term doctor or nurses use as a warning. People with pre-diabetes do not yet have diabetes, but they are at increased risk of getting it.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
