var title_f40_59_41916="Calcium blockers post MI";
var content_f40_59_41916=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F74199&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F74199&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Calcium channel blockers do not change mortality after acute MI",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 372px; height: 200px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A meta-analysis of controlled trials of calcium channel blockers in postinfarction patients failed to show any effect on mortality, although the agents that reduce heart rate, particularly verapamil, showed a trend toward an improved survival while nifedipine, which increases heart rate, showed a trend toward an increased mortaltiy.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Held PH, Yusuf S. In: Cardiovascular Pharmacology and Therapeutics, Singh BN, Dzau V, Vanhoutte PM, Woosley RL (Eds), Churchill Livingstone, New York, 1993, p. 525.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
